import copy
import random
import math


ITEMS = {} #weights and values
RANGES = [] # max count of items for each dimension here each item represent one dimension

# CAPACITY= [100,300,400,500,600,1800,3000, 50000] # total weight of bag , i.e. max quantity
CAPACITY= [0,600,600,1800,1800,3000,0,0,0,5000, 0,0,0,0,0,0,0,0,0,5400] # 2nd total weight of bag , i.e. max quantity

'''
    Below method is used to generate random items based on weights and values provided 
    Capacity is also pre-defined global variable and capacites can be changed as per each experiment
    Then RANGES are caculated for each item in knapsack
'''
def generate_random_items_ranges(dimensions):
    RANGES.clear()
    capacity=0
    random.seed()
    for i in range(0, dimensions):
        ITEMS[i] = (random.randint(1, 30), random.randint(1, 10))  #weights and value
        # capacity += ITEMS[i][0]

    # CAPACITY = capacity

    for i in range(0, dimensions):
        RANGES.append(int(CAPACITY / ITEMS[i][0]))

    print("ITEMS: ", ITEMS, " ,  RANGES: ", RANGES, " ,  CAPACITY : ", CAPACITY)
    return ITEMS, RANGES, CAPACITY

# Define the function to calculate the objective value - WORKING CORRECT
def knapsack_objective_fun_without_probablity_1(solution, capacity, ITEMS, dimensions):
    total_weight = 0
    total_value = 0
    #print(dimensions)
    for i in range(0, dimensions):
        #print( "  ITEMS[i][0]  ", ITEMS[i][0]  , "  i ", i)
        total_weight += ITEMS[i][0] * solution[i]

        total_value += ITEMS[i][1] * solution[i]

    if total_weight > capacity:
        return -1, -1
    else:
        return total_weight, total_value


#below function is used in PSO and WO  GWO to get n_particals initials positions
def _initialize_particles_position(n_particles, dimensions, RANGES, CAPACITY):
    particles=[]
    for i in range(n_particles):
        particle = []
        for j in range(dimensions):
            particle.append(random.uniform(0, RANGES[j]))  # Generate a random number between 0 and capacity for each dimension

        particles.append(particle)
    return particles

