# Initialize a solution with a random item selection without repetition
def initialize_solution(items, capacity, dim):
    remaining_capacity = capacity
    unused_items = set(range(dim))  # Track unused items by their indices

    RANGES1 = [0 for i in range(dim)]

    while remaining_capacity > 0 and unused_items:
        item_index = random.choice(tuple(unused_items))  # Choose a random unused item
        unused_items.remove(item_index)  # Remove it from the set of unused items

        item = items[item_index]

        max_possible = remaining_capacity // item[0]
        count =0
        if max_possible > 0:
            count = random.randint(0, max_possible)
            remaining_capacity -= item[0] * count
        RANGES1[item_index] = count
    return RANGES1


