from matplotlib import animation

import numpy as np
import matplotlib.pyplot as plt

def animate_func(i, data, yvals ,ax, up, low, plt):
    ax.clear()  # Clears the figure to update the line, point,

    X = np.linspace(low,up, 1000)
    Y = np.linspace((-1) * up, up, 1000)
    XY = np.array([X])

    ax.plot3D(data[0, :i], data[1, :i], yvals[0, :i], c='blue')
    # Updating Point Location
    ax.scatter(data[0,:i], data[1,:i], yvals[0,0:i], c='blue',linewidth=0.2)

    ax.set_xlabel('x')
    ax.set_ylabel('y')
    ax.set_zlabel('z')
    #print(" frame num: ", i)


def _visualize_(positions, yvals, MAX_ITER, algorithmName):
    print("plot ")
    fig = plt.figure()
    ax = plt.axes(projection='3d')

    data = np.array(list(positions)).T
    yvals1 = np.array([yvals]).T

    print(positions)
    print(yvals1)
    ani = animation.FuncAnimation(fig, animate_func, fargs=(data, yvals1, ax, max(yvals1), 0, plt), interval=100,
                                  frames=MAX_ITER, repeat=False)

    writergif = animation.PillowWriter(fps=MAX_ITER)
    ani.save(algorithmName + '.gif', writer=writergif)
    # Display the plot
    plt.show()



